import React, { Component, Fragment } from 'react';
import { Link } from 'react-router-dom';

class Nav extends Component {

    state = {
        count: 20,
        value: 0
    };

    changeItemOfMenu = ( vl ) => (
        this.setState({ value: vl })
    );

    render = () => {
        return (
            <Fragment>
                <nav>
                    <ul>
                        <li><Link to={'/'}>Home</Link></li>
                        <li><Link to={'/topic'}>Topic</Link></li>
                    </ul>
                </nav>
            </Fragment>
        )
    }
}

export default Nav;
